import React from 'react';
import IdeaCard from './IdeaCard.js'

const IdeasContainer = ({ ideas }) => {

  const ideaCards = ideas.map((idea) => {
    return <IdeaCard {...idea} />
  })

  return (
    <div className="card-container">
      { ideaCards }
    </div>
  )
}

export default IdeasContainer;
